import React from 'react'
import Link from 'next/link'

import { AppStyledLink } from './AppStyledLink'

export const AppRouterLink = ({ href, children, ...rest }) => {
  return (
    <Link href={ href } >
      <AppStyledLink { ...rest }>
        { children }
      </AppStyledLink>
    </Link>
  )
}
